import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
import type { Aluno } from "../types/Aluno";

// Substitua pelo Base64 da logo da Prefeitura de Manaus para exibição no topo [cite: 2]
const LOGO_PREFEITURA = "data:image/png;base64,"; 

export const gerarPDFDeclaracao = (aluno: Aluno, dados: { mes: string, dias: number, presencas: number }) => {
  const doc = new jsPDF();
  const faltas = dados.dias - dados.presencas;
  const frequencia = ((dados.presencas / dados.dias) * 100).toFixed(0);
  const dataHoje = new Date();
  const dataFormatada = `${dataHoje.getDate()} de ${dataHoje.toLocaleString('pt-BR', { month: 'long' })} de ${dataHoje.getFullYear()}`;

  // --- CABEÇALHO OFICIAL (Baseado no modelo SEMED) --- [cite: 1, 2, 3]
  try {
    doc.addImage(LOGO_PREFEITURA, "PNG", 15, 10, 35, 25);
  } catch (e) { console.warn("Logo Base64 ausente."); }

  doc.setFont("helvetica", "bold");
  doc.setFontSize(10);
  doc.text("PREFEITURA DE MANAUS", 105, 15, { align: "center" }); // [cite: 2]
  doc.text("SECRETARIA MUNICIPAL DE EDUCAÇÃO", 105, 20, { align: "center" }); // [cite: 3]
  
  doc.setFontSize(9);
  doc.text("ESCOLA: 1606 CMEI JEAN PIAGET", 105, 28, { align: "center" }); // [cite: 5]
  doc.setFont("helvetica", "normal");
  doc.text("ENDEREÇO: R. LAURO BITTENCOURT - SANTO ANTONIO - MANAUS", 105, 33, { align: "center" }); // [cite: 7, 8]
  doc.text("CEP 69029-060 TELEFONE (92) 3216-8121", 105, 38, { align: "center" }); // [cite: 9]
  
  doc.setFontSize(8);
  doc.text("ATO DE CRIAÇÃO: LEI 601/2001 DE 03/07/2001 Gabinete Prefeito DOM 03/07/2001", 105, 43, { align: "center" }); // [cite: 11]
  doc.text("INEP: 13081446", 105, 48, { align: "center" }); // [cite: 31]

  doc.line(15, 52, 195, 52);

  // --- TÍTULO --- [cite: 12]
  doc.setFontSize(12);
  doc.setFont("helvetica", "bold");
  doc.text("DECLARAÇÃO DE MATRÍCULA E FREQUÊNCIA", 105, 62, { align: "center" });

  // --- DADOS DO ALUNO ---
  doc.setFontSize(10);
  doc.text(aluno.nome.toUpperCase(), 15, 75); // [cite: 13]
  
  doc.setFontSize(9);
  doc.text(`CÓDIGO ALUNO: ${aluno.matricula || "---"}`, 15, 82); // [cite: 15]
  doc.text(`DATA NASCIMENTO: ${aluno.dataNascimento}`, 120, 82); // [cite: 17]
  doc.text(`FASE: ${aluno.fase.toUpperCase()} ${aluno.turma.toUpperCase()}`, 15, 89); // [cite: 28, 29]
  doc.text(`TURNO: ${aluno.turno.toUpperCase()}`, 120, 89); // [cite: 30]

  // --- CORPO DO TEXTO (Conforme modelo oficial) --- [cite: 32]
  doc.setFont("helvetica", "normal");
  const corpo = `Declaramos para os devidos fins que a criança acima identificada, encontra-se matriculada neste Estabelecimento de Ensino, na Fase Pré-Escolar da educação Infantil, turma ${aluno.fase.toUpperCase()} ${aluno.turma.toUpperCase()}, turno ${aluno.turno.toLowerCase()}. Apresenta a seguinte frequência escolar:`;
  
  const splitCorpo = doc.splitTextToSize(corpo, 180);
  doc.text(splitCorpo, 15, 100);

  doc.setFont("helvetica", "bold");
  doc.text(`FREQUÊNCIA ANO LETIVO 2025`, 15, 115); // [cite: 34]

  // --- TABELA DE FREQUÊNCIA --- 
  autoTable(doc, {
    startY: 120,
    head: [['MÊS', 'FALTAS', 'FREQUÊNCIA', 'OBSERVAÇÃO']],
    body: [
      [`${dados.mes}/2025`, faltas.toString().padStart(2, '0'), `${frequencia}%`, '********']
    ],
    headStyles: { fillColor: [240, 240, 240], textColor: [0, 0, 0], fontStyle: 'bold' },
    theme: 'grid',
    styles: { halign: 'center', fontSize: 9 }
  });

  // --- DATA E ASSINATURAS --- [cite: 36]
  const finalY = (doc as any).lastAutoTable.finalY + 25;
  doc.text(`MANAUS, ${dataFormatada}.`, 105, finalY, { align: "center" }); // [cite: 36]

  // Campo Secretário(a) [cite: 37, 39]
  doc.line(25, finalY + 30, 95, finalY + 30);
  doc.setFontSize(8);
  doc.text("PORT. 0515/2023 VALTER DE OLIVEIRA VIEIRA", 60, finalY + 34, { align: "center" }); // [cite: 37]
  doc.text("SECRETÁRIO(A)", 60, finalY + 38, { align: "center" }); // [cite: 39]

  // Campo Diretor(a) [cite: 38, 40]
  doc.line(115, finalY + 30, 185, finalY + 30);
  doc.text("PORT. 0114/2017 CARLA CLAUDIA LIMA MARTINS", 150, finalY + 34, { align: "center" }); // [cite: 38]
  doc.text("DIRETOR(A)", 150, finalY + 40, { align: "center" }); // [cite: 40]

  doc.save(`Declaracao_${aluno.nome.replace(/\s+/g, '_')}.pdf`);
};